color_lookup = {
    'gneg': (1., 1., 1.),
    'gpos25': (.6, .6, .6),
    'gpos50': (.4, .4, .4),
    'gpos75': (.2, .2, .2),
    'gpos100': (0., 0., 0.),
    'acen': (.8, .4, .4),
    'gvar': (.8, .8, .8),
    'stalk': (.9, .9, .9),
    'green': (.4, .8, .4, .8),
    'blue': (.3, .5, .8, .7)}
height = 0.9
spacing = 0.15


def ideograms(fn):
    last_chrom = None
    fin = open(fn)
    fin.readline()
    xranges, colors = [], []
    ymin = 0
    for line in fin:
        chrom, start, stop, stain, label = line.strip().split()
        start = int(float(start))
        stop = int(float(stop))
        width = stop - start
        if chrom == last_chrom or (last_chrom is None):
            xranges.append((start, width))
            colors.append(color_lookup[stain])
            last_chrom = chrom
            continue
        ymin += height + spacing
        yrange = (ymin, height)
        yield last_chrom, xranges, yrange, colors, label
        xranges, colors = [], []
        xranges.append((start, width))
        colors.append(color_lookup[stain])
        last_chrom = chrom
    # last one
    ymin += height + spacing
    yrange = (ymin, height)
    yield chrom, xranges, yrange, colors, label


